import React from 'react';
import { useNavigate } from 'react-router-dom';
import {
  Box,
  Typography,
  Grid,
  Paper,
  Button,
  Chip,
  TextField,
  InputAdornment
} from '@mui/material';
import SearchIcon from '@mui/icons-material/Search';
import productos from '../../data/productos.json';

export default function Comprar() {
  const navigate = useNavigate();
  const isLoggedIn = Boolean(localStorage.getItem('token'));

  const handleCompra = (id) => {
    if (!isLoggedIn) {
      navigate('/login');
    } else {
      navigate(`/comprar/${id}`);
    }
  };

  return (
    <Box className="comprar-container">
      {/* Encabezado institucional */}
      <Box className="comprar-header">
        <Typography
          variant="h6"
          component="a"
          href="/"
          className="comprar-logo"
        >
          Mercado AgrÃ­cola
        </Typography>
        <TextField
          placeholder="Buscar productos..."
          size="small"
          className="comprar-search"
          InputProps={{
            startAdornment: (
              <InputAdornment position="start">
                <SearchIcon sx={{ color: 'gray' }} />
              </InputAdornment>
            )
          }}
        />
      </Box>

      {/* Banner institucional desde JSX */}
      <Box
        sx={{
          width: '100%',
          height: { xs: 180, md: 240 },
          backgroundImage: 'url("/imagenes/banner-pago.webp")',
          backgroundSize: 'cover',
          backgroundPosition: 'center',
          display: 'flex',
          justifyContent: 'center',
          alignItems: 'flex-end',
          px: 2,
          py: 2
        }}
      >
        <Typography
          variant="h6"
          sx={{
            color: '#fff',
            backgroundColor: 'rgba(0,0,0,0.5)',
            px: 2,
            py: 1,
            borderRadius: 2,
            fontWeight: 'bold'
          }}
        >
          Â¿Transferencia o Tarjeta? Â¡TÃº eliges!
        </Typography>
      </Box>

      {/* CategorÃ­as visuales */}
      <Box className="comprar-section">
        <Typography className="comprar-section-title">
          CategorÃ­as destacadas
        </Typography>
        <Grid container spacing={3}>
          {['Perro', 'Gato', 'Limpieza y Aseo', 'JardinerÃ­a'].map((cat, idx) => (
            <Grid item xs={6} sm={3} key={idx}>
              <Paper className="comprar-card categoria-card">
                <img
                  src={`/imagenes/categorias/${cat.toLowerCase().replace(/ /g, '-')}.webp`}
                  alt={cat}
                  className="comprar-image"
                />
                <Typography className="comprar-card-title">{cat}</Typography>
              </Paper>
            </Grid>
          ))}
        </Grid>
      </Box>

      {/* Productos destacados */}
      <Box className="comprar-section">
        <Typography className="comprar-section-title">
          Productos destacados
        </Typography>
        <Grid container spacing={4}>
          {productos.map((prod) => (
            <Grid item xs={12} sm={6} md={4} key={prod.id}>
              <Paper className="comprar-card producto-card" sx={{ position: 'relative' }}>
                <img
                  src={prod.imagen}
                  alt={prod.nombre}
                  className="comprar-image"
                />
                <Typography className="comprar-card-title">{prod.nombre}</Typography>
                <Typography className="comprar-precio">
                  Precio: {prod.precio} USD
                </Typography>
                {prod.descuento && (
                  <Chip
                    label={`-${prod.descuento}%`}
                    color="error"
                    size="small"
                    className="comprar-descuento"
                  />
                )}
                {isLoggedIn && (
                  <Button
                    variant="contained"
                    color="success"
                    fullWidth
                    onClick={() => handleCompra(prod.id)}
                    className="comprar-boton"
                  >
                    Comprar
                  </Button>
                )}
              </Paper>
            </Grid>
          ))}
        </Grid>
        {!isLoggedIn && (
          <Box className="comprar-sesion">
            <Typography className="comprar-sesion-text">
              Debes iniciar sesiÃ³n para realizar compras ð
            </Typography>
            <Button variant="outlined" href="/login" className="comprar-sesion-boton">
              Iniciar sesiÃ³n
            </Button>
          </Box>
        )}
      </Box>
    </Box>
  );
}
